import './App.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import JobTable from './components/table/EditableTable';
import NewJob from './pages/NewJob';

function App() {
  return (
    <Router>
      <div className="App">
        <div className="content">
          <Switch>
            <Route exact path="/" component={null} />
            <Route exact path="/JobTable">
              <JobTable
                jobTitle="Job Title"
                jobLocationT="Job Location"
                jobLocation="ocation"
                location1="New York"
                location2="London"
                startDate="Start Date"
                endDate="End Date"
              />
            </Route>
            <Route exact path="/NewJob" component={NewJob} />
          </Switch>
        </div>
      </div>
    </Router>
  );
}

export default App;
